import React from 'react'

class Ranking extends React.Component{

    state = {
        rankingList: []
    }

    componentDidMount = () => {
        fetch("/api/ranking")
          .then(res =>  res.json())
          .then(data => {
            this.setState({rankingList: data})
          })
          .catch(e => {
            console.error(e)
          })
      } 

    render(){
        const rankingList = this.state.rankingList
        return (
            <div>
                <ul>
                {rankingList && rankingList.map(ranking => {
                    return <li>{ranking}</li>
                })}
                </ul>
            </div>
        )
    }
}

export default Ranking
